                              initWithTitle:title message:message
                              completion:^(UIAlertView *alertView, NSInteger buttonIndex) {
                                  if (buttonIndex == 1) {
                                      completion([alertView textFieldAtIndex:0].text,[alertView textFieldAtIndex:1].text);
                                  }
